import React from "react";

export default function Navbar() {
  return (
    <header className="header-top">
      <div className="content">
        <div className="nav">
          <div className="nav-wrapper"> </div>
          <div className="search-bar"></div>
        </div>
      </div>
      ;
    </header>
  );
}
